import React, { useState } from 'react';

const ContactForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    confirmPhone: '',
    city: '',
    age: '',
    capital: '',
    experience: '',
    contactTime: '',
    enroll: '',
    acceptTerms: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!formData.acceptTerms) {
      alert("Please accept the terms and privacy policy.");
      return;
    }

    try {
      const response = await fetch('http://localhost:3000/submit-form', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      const data = await response.json();
      alert(data.message || 'Form submitted successfully!');
    } catch (err) {
      alert('Submission failed.');
    }
  };

  return (
  <div className='md:py-40 flex justify-evenly items-center'>
    <div className='w-1/4 h-screen bg-white '>

    </div>
      <form
      className="max-w-2xl mx-auto bg-red-500 text-white p-8 rounded-lg shadow-md space-y-4"
      onSubmit={handleSubmit}
    >
      <h2 className="text-2xl font-bold mb-4">Contact Form</h2>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <input type="text" name="firstName" placeholder="First Name *" className="p-2 rounded text-black" required onChange={handleChange} />
        <input type="text" name="lastName" placeholder="Last Name *" className="p-2 rounded text-black" required onChange={handleChange} />
      </div>

      <input type="email" name="email" placeholder="Email *" className="w-full p-2 rounded text-black" required onChange={handleChange} />

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <input type="tel" name="phone" placeholder="Phone *" className="p-2 rounded text-black" required onChange={handleChange} />
        <input type="tel" name="confirmPhone" placeholder="Confirm Phone *" className="p-2 rounded text-black" required onChange={handleChange} />
      </div>

      <input type="text" name="city" placeholder="City *" className="w-full p-2 rounded text-black" required onChange={handleChange} />

      <input type="number" name="age" placeholder="Age *" className="w-full p-2 rounded text-black" required onChange={handleChange} />

      <select name="capital" className="w-full p-2 rounded text-black" required onChange={handleChange}>
        <option value="">How much capital are you planning to trade with? *</option>
        <option value="Less than 10k">Less than ₹10,000</option>
        <option value="10k-50k">₹10,000 - ₹50,000</option>
        <option value="50k+">More than ₹50,000</option>
      </select>

      <select name="experience" className="w-full p-2 rounded text-black" required onChange={handleChange}>
        <option value="">How much trading experience do you have? *</option>
        <option value="None">None</option>
        <option value="Beginner">Beginner</option>
        <option value="Intermediate">Intermediate</option>
        <option value="Expert">Expert</option>
      </select>

      <input type="text" name="contactTime" placeholder="Preferable Time to Contact *" className="w-full p-2 rounded text-black" required onChange={handleChange} />

      <div className="space-y-2">
        <p>Would you like to enroll for the upcoming batch? *</p>
        <div>
          <label className="mr-4">
            <input type="radio" name="enroll" value="Yes" onChange={handleChange} required /> Yes
          </label>
          <label>
            <input type="radio" name="enroll" value="No" onChange={handleChange} /> No
          </label>
        </div>
      </div>

      <div className="flex items-center space-x-2">
        <input type="checkbox" name="acceptTerms" checked={formData.acceptTerms} onChange={handleChange} />
        <label>Accept terms and privacy policy *</label>
      </div>

      <button type="submit" className="bg-black hover:bg-gray-800 text-white font-bold py-2 px-4 rounded">
        Send Message
      </button>
    </form>
  </div>
  );
};

export default ContactForm;
